import { Link } from "react-router-dom";
const FoodNav = () => {
    return (
        <div className="container">
            <Link to={'/find/:city/:gu/:kw'} className={`btn btn-primary ${style.mainBut}`}>Search</Link>
            <Link to={'/comm'} className={`btn btn-primary ${style.mainBut}`}>Community</Link></div>);
};
export default FoodNav;
